<?php

namespace Salle\PuzzleMania\Controller;

use Psr\Http\Message\ServerRequestInterface as Request;
use Psr\Http\Message\ResponseInterface as Response;
use Salle\PuzzleMania\Repository\UserRepository;
use Slim\Views\Twig;
use Salle\PuzzleMania\Service\BarcodeGenerator;
class LandingPageController
{
    private $twig;
    private $userRepository;

    public function __construct(
        Twig $twig,
        UserRepository $userRepository
    )
    {
        $this->twig = $twig;
        $this->userRepository = $userRepository;
    }

    public function show(Request $request, Response $response): Response
    {
        if (!isset($_SESSION['user_id'])) {
            $username = "stranger";
        } else {
            $user = $this->userRepository->getUserById(intval($_SESSION['user_id']));
            $username = explode('@', $user->email)[0];
        }

        $barcodeGenerator = new BarcodeGenerator();

        $imgDaa = $barcodeGenerator->simpleQRBase64("123");
        $mime = 'image/jpeg';
        $img = ('data:' . $mime . ';base64,' . $imgDaa);
        //$img = " data:image/png;base64,";
        return $this->twig->render($response, 'home.twig', [
            "username" => $username,
            //TODO added for barcode test
           "img_test" => $imgDaa
        ]);
    }

}